import React from "react";
import "./Header.css";

export default function Header() {
  return (
    <header>
      <div className="header-container">
        <img src="logoMohair.png" alt="logo" className="logo" />
        <h1>Mohair des Quatre Saisons</h1>
      </div>
    </header>
  );
}
